import React from 'react';
import './styles.css'; // Import CSS for Register page
import { Formik, useFormik } from 'formik';
const RegisterPage = () => {
    const formik = useFormik({
        initialValues:{
            firstName:'a',
            email: '',
            mobile:'',
            password: ''
        }
    })
  return (
    <>
      <div className="register-container">
        <div className="register-box">
            <h1>{formik.values.firstName}</h1>
          <h2 className="register-title">Register</h2>
          <input type="text" placeholder="Full Name" name="firstname" className="register-input"  />
          <input type="email" placeholder="Email" className="register-input" />
          <input
                  type="text"
                  className="form-control"
                  name="mobile"
                  value={formik.values.mobile}
                  onChange={formik.handleChange}
                />
              </div>
 
              <div className="form-group">
          <input
                  type="text"
                  className="form-control"
                  name="password"
                  value={formik.values.password}
                  onChange={formik.handleChange}
                />
          <button className="register-button">Sign Up</button>

          <p className="register-toggle">
            Already have an account? <a href="/login" className="register-link">Sign In</a>
          </p>
        </div>
      </div>
    </>
  );
};

export default RegisterPage;
